test('atomic/core/UrlTypeTest',['tinymce/inlite/core/UrlType'],function(U){var t=function(){var m=['com','org','edu','gov','uk','net','ca','de','jp','fr','au','us','ru','ch','it','nl','se','no','es','mil'];assert.eq(U.isDomainLike('www.site.com'),true);assert.eq(U.isDomainLike('www.site.xyz'),true);assert.eq(U.isDomainLike('   www.site.xyz'),true);assert.eq(U.isDomainLike('site.xyz'),false);m.forEach(function(b){assert.eq(U.isDomainLike('site.'+b),true);assert.eq(U.isDomainLike('  site.'+b),true);assert.eq(U.isDomainLike('site.'+b+'  '),true);});assert.eq(U.isDomainLike('/a/b'),false);};var a=function(){assert.eq(U.isAbsolute('http://www.site.com'),true);assert.eq(U.isAbsolute('https://www.site.com'),true);assert.eq(U.isAbsolute('www.site.com'),false);assert.eq(U.isAbsolute('file.gif'),false);};t();a();});
